#IMPERIAL 
    imperial_culture:0 "Imperial"
    imperial_culture_prefix:0 "Imperial"
    imperial_culture_collective_noun:1 "Imperials"
    imperial_culture_desc:0 "Seen as the stereotypical Imperials culture flourishes in the region around Lake Rumare and the Imperial Isle, aptly known as the Imperials. One of the most prosperous and bountiful areas in all of Tamriel, the Imperials have attracted the attention from numerous conquerors and warlords, eager to control the sprawling farmlands of central Cyrodiil. \n\nThis noble culture is known for its fine arts and entertainment, which can be observed on the opulent gladiatorial matches and vast urban gardens of the Imperial City, a taste inherited from the ancient Ayleids that inhabited the region. Heartlanders leverage their central position to project power over all of Cyrodiil, and through it, Tamriel as a whole. They have been at the helm of Empires multiple times, a testament to their shrewd management and political skill."
    language_cyrodiilic_name:0 "Cyrodiilic"
    name_list_imperial:0 "Imperial"
    mercenary_knights_brigand_emperor_article:0 "the "
    mercenary_knights_brigand_emperor:0 "Legion of the Brigand Emperor"
    mercenary_blackboot_cohort_article:0 "the "
    mercenary_blackboot_cohort:0 "Blackboot Cohort"
    mercenary_lonely_harp_highlanders_article:0 "the "
    mercenary_lonely_harp_highlanders:0 "Lonely Harp Highlanders"
    mercenary_black_daggers_article:0 "the "
    mercenary_black_daggers:0 "Black Dagger Brigands"
    mercenary_knights_legion:0 "Legion of [TITLE.GetNameNoTierNoTooltip]"
    mercenary_knights_legion_article:0 "the "
    language_cyrodiilic_desc:0 "Cyrodilic is spoken in the Heart of Tamriel but also everywhere where Imperial influence once extended. As a mother tongue, however, it is only in Cyrodiil proper and some heavily imperialized cultures that you will find it. Ayleidoon and Nordic amongst others have all bestowed something upon this Nedic language, a testament to the Cyrodiils history of cultural exchange."
   #DUNMERIS
    dunmer:1 "Dunmer"
    dunmer_prefix:0 "Adduno"
    dunmer_collective_noun:1 "Dunmeri"
    dunmer_desc:0 "The Mage-Lords that settled the lands beyond the Chi-lani came late into the fold of Resdayn, and long endured with their own traditions and sometimes bizarre customs. Refusing to part with meritocratic rule by the strongest mages, the tower-building sages eventually formed House Telvanni, which joined the other Dunmeri Houses under several provisions and exemptions. Even now, the Dunmer of the north-east are a curious lot, prone to paranoia and almost eremitical bouts of secretiveness, exotic and unknown even to their fellow elves, and laissez-faire with regards to cultural norms sacred to their kin."
